import React, { useState } from 'react';
import { Link, Route, Routes } from 'react-router-dom';
import PRLCourses from './Courses';
import PRLReports from './Reports';
import PRLMonitoring from './Monitoring';
import PRLRating from './Rating';
import PRLClasses from './Classes';

const PRLDashboard = () => {
  const [sidebarOpen, setSidebarOpen] = useState(false);

  const handleLogout = () => {
    localStorage.removeItem('token');
    window.location.href = '/login';
  };

  return (
    <>
      {/* Custom Styles for hover effects */}
      <style>
        {`
          .nav-link:hover {
            background-color: #495057;
            color: #ffc107 !important;
            border-radius: 4px;
            text-decoration: underline;
          }

          .btn:hover {
            background-color: #e0e0e0;
            color: #3f0071 !important;
            text-decoration: underline;
          }
        `}
      </style>

      <div style={{ display: 'flex', minHeight: '100vh', fontFamily: 'Arial, sans-serif', backgroundColor: '#f4f6f9', position: 'relative' }}>
        {/* Sidebar */}
        <nav
          className={`bg-dark text-white p-3 ${sidebarOpen ? 'w-25' : 'w-15'} transition-all`}
          style={{
            minHeight: '100vh',
            width: sidebarOpen ? '250px' : '200px',
            transition: 'width 0.3s',
            backgroundColor: '#343a40',
            boxShadow: '2px 0 5px rgba(0, 0, 0, 0.1)',
          }}
        >
          <button
            className="btn btn-light mb-3"
            onClick={() => setSidebarOpen(!sidebarOpen)}
          >
            {sidebarOpen ? '<<' : '>>'}
          </button>
          <ul className="nav flex-column" style={{ padding: 0, margin: 0 }}>
            {[
              { to: '/prl/dashboard/courses', label: 'Courses' },
              { to: '/prl/dashboard/reports', label: 'Reports' },
              { to: '/prl/dashboard/monitoring', label: 'Monitoring' },
              { to: '/prl/dashboard/rating', label: 'Rating' },
              { to: '/prl/dashboard/classes', label: 'Classes' },
            ].map((item, index) => (
              <li key={index} style={{ marginBottom: '15px' }}>
                <Link
                  to={item.to}
                  className="nav-link"
                  style={{
                    color: '#ffffff',
                    textDecoration: 'underline',
                    fontSize: '16px',
                    padding: '10px 15px',
                    display: 'block',
                    borderRadius: '5px',
                    transition: 'background-color 0.2s',
                  }}
                >
                  {item.label}
                </Link>
              </li>
            ))}
          </ul>
        </nav>

        {/* Main Content */}
        <main
          style={{
            flexGrow: 1,
            backgroundColor: '#f8f9fa',
            minHeight: '100vh',
            padding: '20px',
            position: 'relative',
          }}
        >
          {/* Logout Button at Top-Right */}
          <button
            onClick={handleLogout}
            style={{
              position: 'absolute',
              top: '10px',
              right: '20px',
              backgroundColor: '#b0c4de',
              border: 'none',
              padding: '8px 16px',
              borderRadius: '5px',
              cursor: 'pointer',
              textDecoration: 'underline',
              fontWeight: 'bold',
            }}
          >
            Logout
          </button>

          {/* Header */}
          <div
            style={{
              backgroundColor: '#3f0071',
              color: 'white',
              padding: '15px 30px',
              display: 'flex',
              justifyContent: 'space-between',
              alignItems: 'center',
              borderRadius: '5px',
              marginBottom: '20px',
            }}
          >
            <h2 style={{ margin: 0, fontSize: '24px', fontWeight: '600', textDecoration: 'underline' }}>PRL Dashboard</h2>
            <div>
              <button
                style={{
                  marginRight: '10px',
                  backgroundColor: '#fff',
                  color: '#3f0071',
                  border: 'none',
                  padding: '8px 15px',
                  borderRadius: '5px',
                  fontWeight: 'bold',
                  cursor: 'pointer',
                  textDecoration: 'underline',
                }}
              >
                Home
              </button>
              <button
                style={{
                  backgroundColor: '#fff',
                  color: '#3f0071',
                  border: 'none',
                  padding: '8px 15px',
                  borderRadius: '5px',
                  fontWeight: 'bold',
                  cursor: 'pointer',
                  textDecoration: 'underline',
                }}
              >
                Add
              </button>
            </div>
          </div>

          {/* Routes */}
          <div style={{ padding: '30px' }}>
            <Routes>
              <Route path="courses" element={<PRLCourses />} />
              <Route path="reports" element={<PRLReports />} />
              <Route path="monitoring" element={<PRLMonitoring />} />
              <Route path="rating" element={<PRLRating />} />
              <Route path="classes" element={<PRLClasses />} />
            </Routes>
          </div>
        </main>
      </div>
    </>
  );
};

export default PRLDashboard;
